package arun;

public class nestedLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
 for (int i=0;i<=4;i++) {
	 
	 System.out.println("outer loop starts");
	for (int j=0;j<=3;j++) {
		System.out.println("inner loop count");
	}
	 
	 System.out.println("outer loop ends");
	 
 }
 
 
 
}
}